import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {
  constructor()
  {
    super()
    this.state = { 
      monsters : [ 
        {
          id : 1,
          name : 'Frankenstein'
        },
        {
          id : 2,
          name : 'Dracula'
        },
        {
          id : 3,
          name : 'ZOmbie'
        }
      ]
    }
  }
  render(){
    return( <div className="App">
          {this.state.monsters.map(monster => (<h1 key={monster.id}> {monster.name} </h1>))}
    </div>);
  }

}

export default App;
